## Create a Tooltip in NextJS using React Context

### Create a Tooltip component

First, create a Tooltip component that will be used in different places in the application. The Tooltip component will have a title and a content. The content will be displayed when the user hovers over the title.
```
import React from "react";

const Tooltip = ({ title, content }) => {
  return (
    <div className="tooltip">
      <div className="tooltip-title">{title}</div>
      <div className="tooltip-content">{content}</div>
    </div>
  );
};

export default Tooltip;
```
### Create a TooltipContext

Next, create a TooltipContext that will be used to store the state of the Tooltip component. The TooltipContext will have a title and a content property. The title property will be used to display the title of the Tooltip component, and the content property will be used to display the content of the Tooltip component.
```
import React, { createContext, useState } from "react";

export const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [title, setTitle] = useState("");
  const [content, setContent] = useState("");

  return (
    <TooltipContext.Provider
      value={{
        title,
        setTitle,
        content,
        setContent,
      }}
    >
      {children}
    </TooltipContext.Provider>
  );
};

export default TooltipProvider;
```
### Use the TooltipContext in the Tooltip component

Now, we can use the TooltipContext in the Tooltip component to store the state of the Tooltip component. We can use the title and content properties to display the title and content of the Tooltip component.
```
import React, { useContext } from "react";
import TooltipContext from "./TooltipContext";

const Tooltip = ({ title, content }) => {
  const { setTitle, setContent } = useContext(TooltipContext);

  return (
    <div className="tooltip">
      <div className="tooltip-title">{title}</div>
      <div className="tooltip-content">{content}</div>
    </div>
  );
};

export default Tooltip;
```
### Use the TooltipContext in the App component

Finally, we can use the TooltipContext in the App component to store the state of the Tooltip component. We can use the title and content properties to display the title and content of the Tooltip component.
```
import React, { useState } from "react";
import Tooltip from "./Tooltip";
import TooltipProvider from "./TooltipContext";

const App = () => {
  const [title, setTitle] = useState("");
  const [content, setContent] = useState("");

  return (
    <TooltipProvider>
      <Tooltip title={title} content={content} />
    </TooltipProvider>
  );
};

export default App;
```
### Conclusion

In this article, we have created a Tooltip component in NextJS using React Context. We have used the TooltipContext to store the state of the Tooltip component and used the title and content properties to display the title and content of the Tooltip component. We have also used the TooltipContext in the App component to store the state of the Tooltip component.

