# React CSS

## Inline Styles

Inline styles are the most basic way to style a react component. You can use the style prop to add inline styles to a react component. The style prop accepts an object with CSS properties as keys and values. For example, to add a background color to a div, you can use the following code:
```
<div style={{ backgroundColor: 'red' }}>Hello World!</div>
```
## CSS Modules

CSS Modules are a way to write CSS in a modular way, where each CSS file is a module and can be imported and used in other CSS files or JavaScript files. To use CSS Modules in a react app, you need to install the css-loader and style-loader packages. Then, you can create a CSS file and import it in your react component like this:
```
import React from 'react';
import styles from './styles.css';

const App = () => {
  return <div className={styles.container}>Hello World!</div>;
};

export default App;
```
In this example, the styles.css file contains the following CSS:
```
.container {
  background-color: red;
}
```
